import React from 'react';
import { Link } from 'react-router-dom';

import './App.css';

export default function HomePage() {
  const navigateToAbout = () => {
    history.push('/about'); // Use history.push to navigate to the /about page
  };

  return (
    <div className="home">
      <button className="top-button" onClick={navigateToAbout}>
        work
      </button>
    </div>
  );
}
